import React from 'react';
import "./styles/Navbar.css";

function Navbar() {
  return (
    <header className="navbar">
        <div className='logo'>
            {/* <img className="logo" src="images/favicon.ico" alt="logo"/> */}
            <span>ScrTracker</span>
        </div>
        <nav>
            <ul className="nav_links">
                <li>
                    <a href="/index">Home</a>
                </li>
            </ul>
        </nav>
    </header>
  )
}

export default Navbar;
